import React, { useState } from "react";
import Navbar from "./Navbar";
import jsPDF from "jspdf";

function IT() {
  const [isProcessing, setIsProcessing] = useState(false);
  const [gaitParameters, setGaitParameters] = useState(null);
  const [patientInfo, setPatientInfo] = useState({
    name: '',
    gender: '',
    height: '',
    illness: ''
  });

  const handleGetGaitParameter = async () => {
    setIsProcessing(true);

    try {
      const response = await fetch('http://127.0.0.1:5000/api/gaitparameters', {
        method: 'POST'
      });

      const result = await response.json();
      if (response.ok) {
        console.log('Gait parameters calculated successfully', result);
        setGaitParameters(result);
      } else {
        console.error('Failed to calculate gait parameters', result);
      }
    } catch (error) {
      console.error('Error calculating gait parameters:', error);
    } finally {
      setIsProcessing(false);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPatientInfo({ ...patientInfo, [name]: value });
  };

  const handleDownloadPDF = () => {
    const doc = new jsPDF();
    doc.setFontSize(20);
    doc.text("Patient Gait Report", 20, 20);

    doc.setFontSize(16);
    doc.text(`Name: ${patientInfo.name}`, 20, 30);
    doc.text(`Gender: ${patientInfo.gender}`, 20, 40);
    doc.text(`Height: ${patientInfo.height}`, 20, 50);
    doc.text(`Illness: ${patientInfo.illness}`, 20, 60);

    doc.setFontSize(18);
    doc.text("Gait Parameters", 20, 80);

    const addGaitParameter = (title, right, left, yOffset) => {
      doc.setFontSize(16);
      doc.text(title, 20, yOffset);
      doc.setFontSize(14);
      doc.text(`Right: ${right.join(', ')}`, 20, yOffset + 10);
      doc.text(`Left: ${left.join(', ')}`, 20, yOffset + 20);
    };

    addGaitParameter("Step Time", gaitParameters.step_time.right, gaitParameters.step_time.left, 100);
    addGaitParameter("Stance Time", gaitParameters.stance_time.right, gaitParameters.stance_time.left, 140);
    addGaitParameter("Swing Time", gaitParameters.swing_time.right, gaitParameters.swing_time.left, 180);
    addGaitParameter("Double Support Time", gaitParameters.ds_time.left_to_right, gaitParameters.ds_time.right_to_left, 220);
    addGaitParameter("Step Length", gaitParameters.step_length.right, gaitParameters.step_length.left, 260);

    doc.setFontSize(16);
    doc.text(`Gait Speed: ${gaitParameters.gait_speed}`, 20, 300);

    doc.save("gait_report.pdf");
  };

  return (
    <div className="w-full mx-auto bg-black text-white justify-center items-center">
      <Navbar />
      <div className="bg-black w-full md:h-[1400px] sm:h-[800px] justify-center items-center">
        <h1 className="mt-10 mb-6 text-center text-3xl">Extracting Gait Info</h1>
        <p className="text-center mb-6 text-lg">
          After clicking on the "Get Gait Parameter" button, you need to first select the original video and then the OpenPose video, which you can get from the 3D plot service.
        </p>

        <div className="flex flex-col justify-center items-center">
          <div className="mb-4">
            <label className="block text-white text-sm font-bold mb-2" htmlFor="name">Name</label>
            <input
              id="name"
              name="name"
              type="text"
              value={patientInfo.name}
              onChange={handleChange}
              className="shadow appearance-none border rounded w-full py-2 px-3 text-black"
            />
          </div>
          <div className="mb-4">
            <label className="block text-white text-sm font-bold mb-2" htmlFor="gender">Gender</label>
            <input
              id="gender"
              name="gender"
              type="text"
              value={patientInfo.gender}
              onChange={handleChange}
              className="shadow appearance-none border rounded w-full py-2 px-3 text-black"
            />
          </div>
          <div className="mb-4">
            <label className="block text-white text-sm font-bold mb-2" htmlFor="height">Height</label>
            <input
              id="height"
              name="height"
              type="text"
              value={patientInfo.height}
              onChange={handleChange}
              className="shadow appearance-none border rounded w-full py-2 px-3 text-black"
            />
          </div>
          <div className="mb-4">
            <label className="block text-white text-sm font-bold mb-2" htmlFor="illness">Illness</label>
            <input
              id="illness"
              name="illness"
              type="text"
              value={patientInfo.illness}
              onChange={handleChange}
              className="shadow appearance-none border rounded w-full py-2 px-3 text-black"
            />
          </div>
          <button onClick={handleGetGaitParameter} className="px-4 py-4 bg-gray-800 text-white rounded-md mb-4">
            {isProcessing ? 'Processing...' : 'Get Gait Parameters'}
          </button>
        </div>

        {gaitParameters && (
          <div className="mx-60 mt-8 bg-gray-200 text-black p-6 rounded-md shadow-lg">
            <h2 className="text-center text-2xl mb-4 text-black font-bold">Gait Parameters</h2>

            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Step Time</h3>
              <p>Right: {gaitParameters.step_time.right.join(', ')}</p>
              <p>Left: {gaitParameters.step_time.left.join(', ')}</p>
            </div>
            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Stance Time</h3>
              <p>Right: {gaitParameters.stance_time.right.join(', ')}</p>
              <p>Left: {gaitParameters.stance_time.left.join(', ')}</p>
            </div>
            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Swing Time</h3>
              <p>Right: {gaitParameters.swing_time.right.join(', ')}</p>
              <p>Left: {gaitParameters.swing_time.left.join(', ')}</p>
            </div>
            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Double Support Time</h3>
              <p>Left to Right: {gaitParameters.ds_time.left_to_right.join(', ')}</p>
              <p>Right to Left: {gaitParameters.ds_time.right_to_left.join(', ')}</p>
            </div>
            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Step Length</h3>
              <p>Right: {gaitParameters.step_length.right.join(', ')}</p>
              <p>Left: {gaitParameters.step_length.left.join(', ')}</p>
            </div>
            <div className="mt-4">
              <h3 className="text-xl text-black font-bold">Gait Speed</h3>
              <p>{gaitParameters.gait_speed}</p>
            </div>

            <div className="flex justify-center mt-8">
              <button onClick={handleDownloadPDF} className="px-4 py-2 bg-gray-800 text-white rounded-md">
                Download Report as PDF
              </button>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

export default IT;
